window.bookSummaryJSON = "<p><b>\"Richly woven, evocative, and absolutely impossible to put down — I was hooked from the first lines! </b><b><i>Dark Shores</i></b><b> has everything I look for in a fantasy novel: fresh, unique settings, a cast of complex and diverse characters, and an unflinching boldness with the nuanced world-building. I loved every word.\" — Sarah J. Maas, #1 </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>Throne of Glass</i></b></p> <p>The Celendor Empire has set its sights on conquering the far side of the world. And the secret to transporting its legions across the treacherous seas is held by seventeen-year-old Teriana.</p> <p>Teriana has always been taught that east must never meet west, but when her closest friend is forced into an unwanted betrothal, she breaks the rule. A decision Teriana comes to regret when her crew are imprisoned and she lands face-to-face with the Empire’s most ruthless—and secretive—commander, Marcus. To save her people, Teriana chooses to guide Marcus and his legions into a world of meddlesome gods and magic. But with dark forces rising on both sides of the seas, the consequences of her alliance with the enemy may be greater than she imagined . . . especially for her heart.<br> <br> <b>A Macmillan Audio production from Tor Teen</b></p>"; 
